import React, { Component } from 'react';
import './App.css';

import { BrowserRouter,Route, Switch } from 'react-router-dom'

class App extends Component {
render() {
  return (
  	<BrowserRouter>
    <div className="App">
      <Switch>
      	<Route/>
      	<Route/>
      	<Route/>
      </Switch>
    </div>
    </BrowserRouter>
  		);
	}
}

export default App;
